import { useState } from "react";
import { useHistory } from "react-router";
import ApiFunctions from "../ApiFunctions";
import Header from "./Header";


const Register =() =>{
    const history = useHistory();
    const [org_name,setOrgName] = useState('');
    const [email,setEmail] = useState('');
    const [password,setPassword] = useState('');
    const [contact_number,setContactNumber] = useState('');

    const register = async (e) => {
        e.preventDefault();
        var data = new FormData();
        data.append('org_name', org_name);
        data.append('email', email);
        data.append('password', password);
        data.append('contact_number', contact_number);
        data.append('user_role', 'org');

        ApiFunctions.register(data,{
            headers:{
                'content-type':'multipart/form-data'
            }
        }).then(response => {
            window.alert('Sucess');
            history.push('/admin');
       
        }).catch(e => {
            window.alert('Some error occured');
            console.log(e);
        })
    }
    return (
        <div className="App">
            <Header />
        


            <section class="home_1" style="background-image: url('./images/register.jpg');">
        <div class="container">
            <div class="heading">
                <h1> Register
                </h1>
            </div>
        </div>
    </section>
    <section class="login_wrapper">
        <div class="container">
            <div class="form_wrap">
                <h3>Register</h3>
                <form>
                    <div class="input">
                        <label>Are you currently located in the State of NY?</label>
                        <select>
                            <option>Yes</option>
                            <option>No</option>
                        </select>
                    </div>

                    <div class="input">
                        <label>First Name</label>
                        <input type="text" placeholder="" value="" />
                    </div>

                    <div class="input">
                        <label>Last Name</label>
                        <input type="text" placeholder="" value="" />
                    </div>

                    <div class="input">
                        <label>Date of Birth</label>
                        <input type="date" placeholder="" value="" />
                    </div>

                    <div class="input">
                        <label>Zip Code</label>
                        <input type="text" placeholder="" value="" />
                    </div>

                    <div class="input">
                        <label>Phone Number</label>
                        <input type="text" placeholder="" value="" />
                    </div>

                    <div class="input">
                        <label>Email</label>
                        <input type="text" placeholder="" value="" />
                    </div>
                    
                   
                    <div class="input">
                        <label>Language</label>
                        <select><option>English</option>
                            <option>French</option>
                        <option></option></select>
                    </div>
                    <div class="input">
                        <label>Address</label>
                        <textarea></textarea>
                    </div>
                    <div class="form_btn">
                        <button type="submit">Register</button>
                    </div>

                </form>
            </div>
        </div>
    </section>



        </div>
    );
}

export default Register;
